import ExpenseItem from "./ExpenseItem";


function Expenses(props) {

    const expenses = [
        { id: "e1", title : "Car Insurance", amount : 200.20, date : new Date(2021, 1, 10) }, // the month is 0-indexed
        { id: "e2", title : "New TV", amount : 400.83, date : new Date(2021, 2, 29) },
        { id: "e3", title : "Health Insurance", amount : 1000.09, date : new Date(2021, 11, 28) },
        { id: "e4", title : "College Fess", amount : 900.11, date : new Date(2021, 11, 27) }
      ];

      return (
        <div>

            <ExpenseItem 
            title = {expenses[0].title} 
            amount = {expenses[0].amount} 
            date = {expenses[0].date}
            />

            <ExpenseItem
            title = {expenses[1].title}
            amount = {expenses[1].amount}
            date = {expenses[1].date}
            />

            <ExpenseItem
            title = {expenses[2].title}
            amount = {expenses[2].amount}
            date = {expenses[2].date}
            />

            <ExpenseItem
            title = {expenses[3].title}
            amount = {expenses[3].amount}
            date = {expenses[3].date}
            />

        </div>

      )
    
}

export default Expenses;
